import "./Admin.css";

import React from "react";
import Sidebar from "./Sidebar";
import SidebarButton from "./SidebarButton";
import { WrenchIcon, UserIcon } from "../../Global";
import { Outlet, useNavigate } from "react-router-dom";

const Admin = () => {
	const navigate = useNavigate();
	return (
		<div id="admin-page">
			<Sidebar id="side-bar">
				<h2>Hệ thống</h2>
				<SidebarButton icon={UserIcon} onClick={() => navigate("/admin/user")}>
					Khách hàng
				</SidebarButton>
				<SidebarButton icon={WrenchIcon} onClick={() => navigate("/admin/bill")}>
					Hóa đơn
				</SidebarButton>
				<SidebarButton icon={WrenchIcon} onClick={() => navigate("/admin/employee")}>
					Nhân viên
				</SidebarButton>
				<SidebarButton icon={WrenchIcon} onClick={() => navigate("/admin/user")}>
					Quản lý
				</SidebarButton>
				<SidebarButton icon={WrenchIcon}>Thống kê</SidebarButton>
			</Sidebar>
			<Outlet />
		</div>
	);
};

export default Admin;
